def compare_numbers(t: int, testcases: List[Tuple[int, int, int, int]]) -> List[str]:
    """
    Compare two numbers efficiently based on their representation with zeros at the end.

    Args:
    t: int - the number of testcases
    testcases: List[Tuple[int, int, int, int]] - a list of tuples containing x1, p1, x2, p2 for each testcase

    Returns:
    List[str] - a list of comparison results for each testcase
    """

    result = []
    for i in range(t):
        x1, p1, x2, p2 = testcases[i]
        if x1 * 10**p1 < x2 * 10**p2:
            result.append('<')
        elif x1 * 10**p1 > x2 * 10**p2:
            result.append('>')
        else:
            result.append('=')
    return result

